import React from 'react'
import styled from 'styled-components'

function NavBar() {
    return (
        <NavBarr>
            <NavBarContainer>

            </NavBarContainer>
        </NavBarr>
    )
}

export default NavBar

const NavBarr = styled.div`
display: flex;
flex-direction: row;
justify-content: left;
align-items: center;
`
const NavBarContainer = styled.div`
width: 50%;
height: 20vh;
background-color: red;
`
